import React, { Component } from 'react'
import logo from './logo.svg';
import './App.css';

import filterCustomer from 'searching-customer-within-a-range';


export class App extends Component {

  constructor(props) {
    super(props)

    this.state = {
       list:''
    }
  }

    componentDidMount(){
      filterCustomer.searchingCustomers().catch((err) => {
      console.log(`Error received: `, err.message);
    }).then((eligibleCustomers) => {
      // console.log(eligibleCustomers);
      if(eligibleCustomers){
        this.setState({
          list:eligibleCustomers
        })
      }
    });
    }
  render() {
    // console.log()
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            <ul>
                  {
                    this.state.list && this.state.list.map((d,i)=>{
                      return (
                        <li><b>Name:</b>{d.name}</li>
                      )
                    })
                  }
            </ul>
          </p>
        </header>
      </div>
    );
  }
}



export default App
